import React from 'react';
import './App.css';
import mainPic from './466F17BB-45C1-460B-9415-F1427BD8C142_1_105_c.jpeg'

function App() {
  return (
    <div>
        <div className='navbar'>

          <h3>Jenas Wedding</h3>
        </div>
        <img src={mainPic} alt= 'MattJena' />
    </div>
  );
}

export default App;
